import React from "react";
import { ScrollView, FlatList, StyleSheet, View, Text } from "react-native";

import AppText from "../components/AppText";
import Screen from "../components/Screen";
import colors from "../config/colors";

//const dyeChoices = choices.dyeChoices;


function Budgets({navi}) {
    return (
      <Screen style={styles.screen}>
        <AppText style={styles.title}>Ingredient Budgets!</AppText>

      <View style={[styles.container, {
        flexDirection: "row"
      }]}/>
      <View style={{ flex: 2}} />
        <Text style={styles.header1}>$25</Text>
        <Text style={styles.text1}>This is a test box for the 25$ menu!</Text>
      <View style={{ flex: 2}} />
        <Text style={styles.header1}>$50</Text>
        <Text style={styles.text1}>This is a test box for the 50$ menu!</Text>
      <View style={{ flex: 2}} />
        <Text style={styles.header1}>$75</Text>
        <Text style={styles.text1}>This is a test box for the 75$ menu!</Text>
      <View style={{ flex: 2}}/>
        <Text style={styles.header1}>$100</Text>
        <Text style={styles.text1}>This is a test box for the 100$ menu!</Text>
      

      </Screen>
    );
}

const styles = StyleSheet.create({
  screen: {
    flex: 1,
    backgroundColor: colors.light,
    //justifyContent: "center",
    //alignItems: "center",
  },
  container: {
    //flex: 2,
    padding: 30,
    //marginBottom: 0,
    //backgroundColor: colors.eltrdarkblue,
  },
  title: {
    color: colors.eltrdarkblue,
    fontSize: 40,
    justifyContent: "center",
    alignItems: "center",
    marginBottom: 20,
    marginTop: 0,
  },
  header1: {
    color: colors.eltrdarkblue,
    fontSize: 25,
    alignItems: "center",
    justifyContent: "center",
  },
  text1: {
    color: colors.eltrdarkblue,
    fontSize: 10,
  },
  
});

export default Budgets;
